            List<List<XYData>> clustersByClusterNumber = new List<List<XYData>>();

            //Clusters signal peaks based on cluster number into lists of XYData
            for (int i = 1; i < clusterNumber[(clusterNumber.Count) - 1]; i++)
            {
                List<XYData> newClusterList = new List<XYData>();
                clustersByClusterNumber.Add(newClusterList);
                for (int j = 0; j < clusterNumber.Count; j++)
                {
                    if (clusterNumber[j] == i)
                    {
                        newClusterList.Add(peakList[j]);
                    }
                }
            }

            int indexNumCounter = 0;

            List<ClusterCP<double>> featureList = new List<ClusterCP<double>>();

            //Places clusters into ClusterCPs
            for (int i = 0; i < clustersByClusterNumber.Count; i++)
            {
                ClusterCP<double> currentFeature = new ClusterCP<double>();
                featureList.Add(currentFeature);
                currentFeature.MonoisotopicMass = clustersByClusterNumber[i][0].X;
                for (int j = 0; j < (clustersByClusterNumber[i].Count-1); j++)
                {
                    DifferenceObject<double> newDifferenceObject = new DifferenceObject<double>();
                    newDifferenceObject.Value1 = clustersByClusterNumber[i][j].X;
                    newDifferenceObject.Value2 = clustersByClusterNumber[i][j+1].X;
                    newDifferenceObject.Difference = newDifferenceObject.Value2-newDifferenceObject.Value1;
                    newDifferenceObject.IndexData = indexNumCounter;
                    newDifferenceObject.IndexMatch = indexNumCounter + 1;
                    indexNumCounter++;
                    currentFeature.Peaks.Add(newDifferenceObject);
                }
            }

            //calculate charge state
            ChargeCalculator.CalculateChargeStateFromDifference(ref featureList); 

            return featureList;
